INSERT INTO GUIDE_STEP_LANGUAGES VALUES (1,1,'Pračka se sušičkou','Jestliže si pořídíte pračku se sušičkou, můžete zapomenout na zdlouhavé sušení prádla venku nebo v bytě. U spousty druhů prádla lze upustit od neoblíbeného žehlení – prádlo po vysušení není zmačkané, volitelné parní programy jej navíc zanechají perfektně nadýchané a voňavé. Pračky se sušičkou jsou ideální nejen do menších prostor, kde ušetří místo. A na co se při výběru zaměřit? Výhody a nevýhody sušiček prádlarnPokud přemýšlíte nad tím, zdali vybrat sušičku jako samostatný spotřebič, nebo zvolit automatickou pračku se sušičkou, podívejte se nejprve na výhody a nevýhody samostatných sušiček níže:'),(2,1,'Volně stojící, nebo vestavná?','Vestavnou pračku oceníte v případě, když se přístroj nevejde do koupelny nebo technické místnosti. Můžete pro ni najít místo třeba v kuchyni a díky jednotnosti dvířek nemusí nikdo vědět, že ji tam máte a pokud zvolíte tichou, pak ani nemusí zaznamenat, že právě perete. I přes zabudování do kuchyňské linky je přístup k pračce bezproblémový, s úchyty pro dvířka přímo na spotřebiči se zde počítá. Výhodou vestavných praček je nenápadnost, nevýhodou zas omezený výběr a vyšší cena. Mnohem větší výběr pak budete mít u volně stojících praček. Ty se pak dělí na ty s horním plněním a s předním (bočním) plněním. '),(3,1,'Plnit předem, nebo vrchem?','Pračky plněné předem jsou nejrozšířenější variantou, jejich zásadní výhodou je obrovská variabilita, a to nejenom funkční, ale i rozměrová. Od hloubky pouhých 33 centimetrů s kapacitou slušných 5 kg, až po pračky dvojnásob hluboké, schopné pojmou přes 10 kg prádla. Cenově můžete koupit pračku za 5 000 Kč, ale taktéž model, jenž stojí více než 60 000 Kč. Funkčně i zpracováním máme co do činění se zcela odlišnými produkty. V neposlední řadě si lze v omezené míře vybrat i barevnou variantu. Pokud nechcete pračku bílou, lze zakoupit modely stříbrné a černé, potkat ale můžete i odvážnější odstíny. Na barevné kreace u praček se specializuje hlavně firma LG.Vrchem plněné pračky jsou praktické hlavně proto, že před sebou nepotřebují žádné místo nutné pro otevření dvířek bubnu, čímž se perfektně hodí hlavně do menších bytů či garsonek. Na trhu je jich podstatně méně než předem plněných variant, nicméně i v tomto produktovém segmentu si lze vybrat modely za velice příznivé ceny. Není tak problém zakoupit pračku do 6 000 Kč, nejvyšší modely se opět prodávají v cenách několika desítek tisíc korun. U vrchem plněných praček nenajdete příliš technických vychytávek, přesto lze zakoupit jak základní modely, kde si uživatel manuálně volí program či teplotu, tak i typy, které po zvolení programu vše nastaví samy, disponují podsvícenými informačními displeji, umožňují volit délku programu apod.');
