INSERT INTO GUIDE_CHOICE_LANGUAGES VALUES (1,1,'[{"item":"Nemusíte sušit prádlo venku nebo v bytě na sušáku"},{"item":"Do značné míry eliminuje nutnost žehlit některé typy prádla"},{"item":"Ušetříte místo v bytě, protože se zbavíte sušáků"},{"item":"Ušetříte čas, který byste věnovali věšení prádla, jeho sbíraní a žehlení"}]',NULL,'Pračka se sušičkou',NULL),(2,1,'[{"item":"Nižší spotřeba energie"},{"item":"Do pračky se vleze větší objem prádla"},{"item":"Můžete použít vaši oblíbenou aviváž"}]',NULL,'Pračka bez sušičky',NULL),(3,1,NULL,NULL,'Volně stojící',NULL),(4,1,NULL,NULL,'Vestavná',NULL),(5,1,'[{"item":"Snadný přesun prádla z koše do bubnu a zpět"},{"item":"Obrovský výběr modelů"},{"item":"Možnost zakoupit modely podstavné nebo vestavné se zasazením do kuchyňské linky nebo koupelnového nábytku"},{"item":"Lepší stabilita"}]',NULL,'Přední plnění',NULL),(6,1,'[{"item":"Díky svým rozměrům se hodí do menších koupelen"},{"item":"Kvůli své výšce se hodí pro starší lidi, kteří se při plnění pračky nemusí tolik ohýbat"},{"item":"Lze ji obestavět, protože před sebou nepotřebuje prostor pro otevírání dvířek"}]',NULL,'Horní plnění',NULL);
