INSERT INTO PRODUCT_LANGUAGES VALUES (1,1,'aeg-prosense-l6fbg68sc','AEG ProSense L6FBG68SC',1,'Úsporné, rychlé, šetrné praní, s minimem vibrací a okolního hluku, jehož výsledkem bude krásně voňavé a dokonale jemné prádlo, které si uchová svůj tvar a strukturu.','Pořiďte si maximálně účinnou, úspornou a rychlou pračku, která bude šetrná a ohleduplná k vašemu oblečení. Sen se stane realitou právě s tímto modelem pračky od renomované německé značky AEG. Technologie ProSense si sama zváží každou náplň a rozhodne o volbě a úpravě programu na míru. Stanoví přesnou délku a průběh praní. Díky tomu ušetříte vodu a energii. Program Eco a TimeSave se postará o co nejkratší možnou délku praní. Množství otvorů na bubnu pračky zajistí šetrné praní a brilantní práci vodních trysek, které významně přispívají k uchování tvaru oblečení nejen během praní, ale především v průběhu odstřeďování. Funkce SoftPlus zajistí, aby se aviváž dostala ke každému kousku vloženého oblečení, a právě díky tomu si z pračky vytáhnete dokonale měkké a příjemně voňavé prádlo.'),(2,1,'indesit-bwsa-61052w','Indesit BWSA 61052W',1,'Volně stojící předem plněná pračka nabídne velkou kapacitu, účinné využití otáček, několik programů včetně programu na vlnu, tichý provoz a nadčasový design v bílé barvě','Za opravdu příznivou cenu získáte praktického pomocníka do domácnosti, který vás navíc překvapí i povedeným designem. Nabídne vám praktické otevírání zepředu, kompaktní rozměry, nízkou hlučnost, jednoduché a logické ovládání a navíc na jeden prací cyklus vypere dostatečné množství prádla, což je opravdu výtečný poměr cena versus kvalita. Jistě oceníte také cyklus automatického čištění, který vyčistí pračku stisknutím jednoho jediného tlačítka. Díky tomu ušetříte čas, práci a peníze za čisticí prostředky. Další praktickou funkcí je Zámek. Ten uvítáte obzvlášť, pokud máte malé děti. Díky zámku zabráníte nechtěnému ovládání, mačkání knoflíků a změně již nastaveného programu. Vaše děti si budou muset najít jinou zábavu.'),(3,1,'indesit-iwsc-51051-c-eco','Indesit IWSC 51051 C ECO',1,'Inteligentní a předem plněná pračka, která se díky svým rozměrům hodí i do menších bytů. Může se pochlubit LED kontrolkami, ochranou proti přetečení a funkcí Energy Saver.','Máte malý byt, a přesto chcete mít skvěle vyprané prádlo bez kompromisů? Tato předem plněná pračka malých rozměrů to zajistí. Velké množství pracích programů, včetně těch specializovaných pro sportovní oděvy, sportovní obuv nebo třeba záclony a džíny, zajistí tu nejlepší péči pro každý kousek vašeho prádla. Funkce pro úsporu času a energií jistě potěší vaši rodinu i peněženku a tichý kolektorový motor zase potěší vaše sousedy. Perfektně se také hodí pro domácnosti s dětmi, dětský program zaručí dokonalé vyprání a vymáchání prádla bez zbytku pracích prášků a tím zajistí citlivé pokožce dětí nebo alergiků tu nejlepší možnou péči.'),(4,1,'whirlpool-fwsf61053w','Whirlpool FWSF61053W',1,'Dopřejte svému prádlu maximální péči s úspornou pračkou, která se pohodlně vejde i do malého bytu. Díky funkci FreshCare+ bude vaše oblečení krásně svěží, voňavé a bez bakterií.','Volně stojící, zepředu plněná a extra úsporná pračka s maximální náplní na 6 kg prádla se díky svým menším rozměrům vejde i do malého bytu. Dvanáct hlavních a dva doplňkové programy zajistí opravdu tu nejlepší péči pro každý materiál. Síla páry a lehoučké rotace bubnu funkce FreshCare+ na konci pracího cyklu prádlo provzdušní, osvěží a navíc zbaví vaše oblečení i pračku bakterií. Speciální program pro sportovní oděvy zajistí dlouhou trvanlivost vašeho funkčního prádla, a pokud nestíháte, jistě oceníte rychlý program na 30 minut. Nechybí ale samozřejmě ani programy pro jemné tkaniny, vlnu nebo třeba možnost nastavení odloženého startu.'),(5,1,'aeg-dualsense-l7wbg47w','AEG Dualsense L7WBG47W',1,'Užitečný pomocník v každodenním boji s prádlem. Praní a sušení je díky speciálním inteligentním technologiím jednoduché, rychlé a šetrné. Speciální cykly chrání a zároveň pečují.','Skvělá kombinace výkonné pračky a šetrné sušičky v jednom přístroji. Chytré technologie se postarají o dokonalý výsledek každého pracího i sušícího cyklu díky detekci náplně, programům na téměř každý druh prádla či parnímu programu, zabraňujícímu pomačkání. Předností je i expresní program, kdy za pouhých 60 minut budete mít vypráno i usušeno.'),(6,1,'whirlpool-awe-50510','Whirlpool AWE 50510',1,'Elegantní pračka s horním plněním a technologii Fuzzy Logic efektivně vypere a navíc ještě ušetří. S 18 chytrými pracími programy se stane ideálním pomocníkem do vaší domácnosti.','Elegantní úzká pračka s horním plněním a technologii Fuzzy Logic nabízí efektivní praní a úsporu elektrické energie i spotřebované vody. Kromě toho zbytečně neplýtvá pracím práškem a dokonce si umí poradit i s nadměrným pěněním prášku. Tato pračka s kapacitou 5 kg disponuje přehledným LED ukazatelem, díky kterému budete mít přehled o průběhu vybraného pracího programu. K dispozici je široká škála 18 pracích programů, mezi nimiž naleznete mimo jiné speciální program pro džíny, rychlý 15 minutový program anebo šetrný program ruční praní.'),(7,1,'electrolux-ewt-1266-elw','Electrolux EWT 1266 ELW',1,'Úzká a velmi energeticky úsporná pračka, která se vám vždy přizpůsobí a zajistí nejšetrnější péči. Zvolte si nejvhodnější prací program a dobu, jak dlouho bude pračka prát! ','Úzká, avšak velmi šikovná pračka, která se vejde i do té nejmenší koupelny! Funkci TimeManager v dnešní době jistě ocení každý. Už se totiž nemusíte přizpůsobovat pračce a čekat klidně i čtyři hodiny, než prádlo dopere. Podle svých časových možností si jednoduše nastavíte, jak dlouho bude pračka prát a délku pracího programu lze zkrátit bez problémů i o polovinu. Buben se snadno otevírá zvrchu a speciální dávkovač FlexiDose Plus dávkuje prací prášek či gel ve správnou chvíli. Podle typu praného prádla si můžete vybrat ze čtrnácti pracích programů, které jsou nastaveny speciálně na šetrné praní například hedvábí, peřin či lehkého sportovního oblečení. S pračkou Electrolux šetříte čas i energii, jelikož má spotřebič velmi nízkou spotřebu energie.'),(9,1,'aeg-prosteam-ltx7c562c','AEG ProSteam LTX7C562C',1,'Elegantní pračka s horním plněním a technologii Fuzzy Logic efektivně vypere a navíc ještě ušetří. S 18 chytrými pracími programy se stane ideálním pomocníkem do vaší domácnosti.','Pračka s vrchním plněním, která se může pochlubit spolehlivým a odolným invertorovým motorem. Invertní technologie snižuje vibrace, čímž minimalizuje opotřebení a dosahuje nejvyššího možného výkonu při nízké hlučnosti. Pomocí účinku páry pračka snižuje pomačkání prádla, díky čemuž ušetříte čas při žehlení. Podle náplně dokáže pračka automaticky vyhodnotit, jaký program zvolit a díky tomu šetří vodu, energii i čas. Funkce SoftPlus se postará o to, aby se aviváž dostala ke každé části tkaniny. Díky tomu je oděv měkčí, hedvábnější i hladší. Zároveň se prodlouží jeho životnost.'),(10,1,'whirlpool-tdlr-60220','Whirlpool TDLR 60220',1,'Úsporná vrchem plněná pračka v energetické třídě A+++ s kapacitou 6,0 kg a otáčkami odstřeďování až 1200 ot/min.','Úsporná vrchem plněná pračka v energetické třídě A+++ s kapacitou 6,0 kg a otáčkami odstřeďování až 1200 ot/min.'),(11,1,'whirlpool-awe-4519','Whirlpool AWE 4519',1,'Energetická třída:  Pračka vrchem plněná Senzorová technologie Fuzzy Logic Energetická třída A+ Roční spotřeba energie 167 kWh Spotřeba energie Bavlna 60°C plná náplň',NULL),(12,1,'indesit-btw-a51052','Indesit BTW A51052',1,'Bílá volně stojící pračka s vrchním plněním speciálně pro menší prostory. Má širokou škálu funkcí, které se postarají o různé druhy prádla, vyváženou spotřebu a správné načasování.','Bílá volně stojící pračka má vrchní plnění a je ideální především pro menší prostory, protože má zúženou šířku 40 cm. Může se pochlubit pohodlnými funkcemi jako je Rychlé praní (pro případ, že pospícháte), Extra praní (pokud potřebujete zpacifikovat obzvláště náročné zaschlé skvrny) nebo třeba Water Balance Plus (program zaměřený na optimalizaci spotřeby vody, energie i času). O ideální načasování se postará odložený start.'),(13,1,'whirlpool-tdlr-70230','Whirlpool TDLR 70230',1,'Elegantní pračka s horním plněním a technologii Fuzzy Logic efektivně vypere a navíc ještě ušetří. S 18 chytrými pracími programy se stane ideálním pomocníkem do vaší domácnosti.','Elegantní úzká pračka s horním plněním a technologii Fuzzy Logic nabízí efektivní praní a úsporu elektrické energie i spotřebované vody. Kromě toho zbytečně neplýtvá pracím práškem a dokonce si umí poradit i s nadměrným pěněním prášku. Tato pračka s kapacitou 5 kg disponuje přehledným LED ukazatelem, díky kterému budete mít přehled o průběhu vybraného pracího programu. K dispozici je široká škála 18 pracích programů, mezi nimiž naleznete mimo jiné speciální program pro džíny, rychlý 15 minutový program anebo šetrný program ruční praní.'),(14,1,'whirlpool-awe-66710','Whirlpool AWE 66710',1,'Super výkonná pračka s horním plněním patří k těm, které musíte mít. Ohromí nejen svou úsporností v kategorii A+++, ale i technologií 6.smysl Colours a 18 jedinečnými programy.','Supervýkonná pračka s horním plněním za báječnou cenu patří k těm, které prostě musíte mít. Základem je technologie 6. smysl, která zajistí optimální výkon pračky pro úsporu energie, vody a času. Ohromí vás nejen úsporností v kategorii A+++, ale i 18 jedinečnými programy včetně programu Jeans anebo Rychlé praní. Tato pračka s kapacitou 6kg zvládne i praní při nižších teplotách, přičemž si dokáže zachovat výkon jako při praní na 40°C. V nižších teplotách můžete také využít u programu Clean+, který prodlouží praní tak, aby byly odstraněny všechny skvrny. Pomocí funkce Eco kulička zbytečně neplýtvá práškem a umí si poradit i s nadměrným pěněním prášku.'),(15,1,'aeg-prosteam-ltx7e372c','AEG ProSteam LTX7E372C',1,'Praktická pračka s vrchním plněním, v prostorově úsporném provedení, s technologií ProSteam využívající účinky páry k osvěžení a menšímu pomačkání oblečení.','Pračka, která nabídne rozumnou a vyváženou skladbu programů, snadnou obsluhu, přehledný a jednoduše ovladatelný displej, tichý chod a praktické víko s otevíráním pomocí tlačítka SoftOpening, včetně systému lehkého otevírání dvířek bubnu, aby bylo vkládání a vyndávání prádla co nejpohodlnější. Samozřejmostí jsou i další sofistikované technologie: ProSteam umožňující dokončit praní s dávkou páry a díky tomu omezit pomačkání prádla a ProSense, která sama zváží vložené prádlo a podle toho přizpůsobí program pro co největší úsporu vody a energie, včetně úpravy času potřebného pro dokonale čisté prádlo. Při praní zároveň pečuje o barvy a snižuje pomačkání oblečení. SoftPlus zajistí, aby se aviváž dostala ke každému vláknu, díky tomu bude prádlo znatelně měkčí a příjemnější na dotek.'),(16,1,'zanussi-zwq-61215wa','Zanussi ZWQ 61215WA',1,'Řekněte sbohem nepříjemným pachům v pračce Víko této pračky nebudete muset nikdy nechat otevřené kvůli větrání. Technologie AirFlow brání tvorbě nepříjemných pachů a plísní','Víko této pračky nebudete muset nikdy nechat otevřené kvůli větrání. Technologie AirFlow brání tvorbě nepříjemných pachů a plísní a zajišťuje vždy svěže vonící buben.'),(17,1,'aeg-prosteam-l7fbe48sc','AEG ProSteam L7FBE48SC',1,'Užívejte si nekonečný pocit svěžesti a dokonale čistého, měkoučkého a voňavého prádla. Pračka je ochráncem nejen vašeho oblíbeného prádla, ale i vaší spotřeby energie a vody','Elegantní, předem plněná, inteligentní a úsporná pračka s širokou škálou speciálních programů, díky kterým bude perfektně postaráno o každý kousek vašeho oblečení do těch nejmenších detailů. Vaše prádlo bude voňavé, velmi příjemné na dotek a úžasně měkké. Chytré technologie si samy zváží náplň pračky a automaticky si zvolí ten nejlepší program. Díky tomu bude vaše prádlo nejen dokonale čisté, ale navíc ještě ušetříte za energie. Pára na konci programu omezí zmačkání, prádlo bude svěží a zbavené všech bakterií, takže vám zbude spousta volného času, který jste dosud museli věnovat žehlení.'),(18,1,'aeg-prosteam-l7fbe68sc','AEG ProSteam L7FBE68SC',1,'Užívejte si nekonečný pocit svěžesti a dokonale čistého, měkoučkého a voňavého prádla. Pračka je ochráncem nejen vašeho oblíbeného prádla, ale i vaší spotřeby energie a vody','Elegantní, předem plněná, inteligentní a úsporná pračka s širokou škálou speciálních programů, díky kterým bude perfektně postaráno o každý kousek vašeho oblečení do těch nejmenších detailů. Vaše prádlo bude voňavé, velmi příjemné na dotek a úžasně měkké. Chytré technologie si samy zváží náplň pračky a automaticky si zvolí ten nejlepší program. Díky tomu bude vaše prádlo nejen dokonale čisté, ale navíc ještě ušetříte za energie. Pára na konci programu omezí zmačkání, prádlo bude svěží a zbavené všech bakterií, takže vám zbude spousta volného času, který jste dosud museli věnovat žehlení.'),(19,1,'samsung-ww70j5446dw','Samsung WW70J5446DW',1,'Užijte si dokonalý výsledek praní i při nízkých teplotách! Perte šetrně a zároveň efektivně. Pomocí digitálního invertorového motoru s 10letou zárukou bude praní tiché a úsporné! ','Tato pračka s velkorysou kapacitou bubnu na 7 kilogramů prádla zařazená do energetické třídy A+++ využívá přelomové technologie Eco Bubble, která chytře přemění prací prostředek na aktivní pěnu a odstraní z prádla snadno a rychle veškeré nečistoty. Aby byl výsledný efekt skutečně dokonalý, disponuje přístroj funkcí Bubble Soak, která hlídá, aby bylo prádlo vždy zcela ponořené v aktivní pěně. A to vše za pomoci technologie StayClean Drawer, která zajišťuje maximální využití použitého pracího prostředku. V neposlední řadě je pračka opatřena Smart Check systémem, který vám nabídne řešení v případě nastalé poruchy.'),(20,1,'superior-xc-racer-2016','Superior XC Racer 2016',1,'Dětské kolo Superior Racer v závodním designu s duralovým rámem a Shimano komponenty. - Nízká hmotnost: maximální důraz na nízkou hmotnost celého kola pro snadné a.','Blatníky steel with coat guard Brzdové páky TEKTRO Brzdy APSE Art