INSERT INTO REVIEWS VALUES (1,3,'Komunikace','s tímto obchodem jsem maximálně spokojená a určitě se budu vracet',5,'2019-03-01 07:00:00.000000',NULL,1,8,'[{"item":"rychlost doručení"}, {"item":"komunikace"}]',NULL),(2,4,'Ochota','Přehledné web stránky, rychlost vyřízení objednávky, doprava zdarma',5,'2019-03-02 14:00:00.000000',NULL,1,8,'[{"item":"nabídka, cena,termín dodání"}]',NULL),(3,5,'Rychlost','Rychlé a bezproblémové vyřízení',5,'2018-03-04 10:00:00.000000',NULL,1,8,NULL,NULL),(4,6,'Rychlost','Skvela komunikace,rychle dodani,takhle by mely fungovat vsechny obchody ..',5,'2019-03-11 20:00:00.000000',NULL,1,8,NULL,NULL),(5,3,'Ceny','Doporučuji ,klidně zde nakoupím znovu.',5,'2019-04-24 14:00:00.000000',NULL,1,9,'[{"item":"nabídka, cena,termín dodání"}]',NULL),(6,4,'Rychlost doručení','Kvalitní zboží za cenu jakou jsem jinde nenašla, velmi spokojena, zaregistrována, až budu potřebovat, budu v nákupech u firmy VEDE pokračovat. Jen taková drobnost - když je tam místo pro poznámku, kam se uvede druhé telefonní číslo, osoby která zboží převezme, tak by se mělo předat řidiči přepravce, aby to věděl.',4,'2019-03-11 14:00:00.000000',NULL,1,9,'[{"item":"rychle a vcas komunikuji, velka spokojenost"}]','[{"item":"zbozi jsem si objednal na konkretni datum, ale bylo mi dodano o par dni drive"}]'),(7,5,'Komunikace','přehledné stránky, dobrá komunikace',5,'2019-04-28 13:00:00.000000',NULL,1,9,NULL,NULL),(8,6,'Nedoporucuji','Obchod uvádí zboží skladem a zboží by odeslali až 5. den',1,'2019-04-14 12:00:00.000000',NULL,1,9,NULL,NULL),(9,3,'Nedoporučuji','Zřejmě nízká cena objednávky, necelých 2000Kč',1,'2019-03-17 15:01:00.000000',NULL,1,10,'[{"item":"Nevím, kdo tuto situaci zavinil. Ale připadá mi, že si neváží zákazníka"}]',NULL),(10,4,'Ceny','s tímto obchodem jsem maximálně spokojená a určitě se budu vracet',4,'2019-04-13 15:00:00.000000',NULL,1,10,NULL,NULL),(11,5,'Rychlost','zboží mi přišlo,ale bohužel rozbalené a použité,aniž by se o tom alespoň zmínili,což mě zklamalo...',1,'2019-03-17 10:00:00.000000',NULL,1,10,NULL,NULL),(12,6,'Zboží není skladem','nic moc',2,'2019-03-15 10:50:00.000000',NULL,1,10,NULL,'[{"item":"Dodnes mě nikdo nekontaktoval že je zboží připravené"}]'),(13,3,'Vyber','velky vyber!',5,'2019-03-19 10:30:00.000000',NULL,1,11,'[{"item":"velky vyber"},{"item":"cena"},{"item":"slevy"}]',NULL),(14,4,'Komunikace','Paní na pokladně byla velice nepříjemná, chtěl jsem pouze ještě dodatečně změnit hlavičku faktury, což byl problém, ale s velkou neochotou to proběhlo. Dále jsem měl v plánu přidat si produkt na zákaznickou kartu a to už jsem ji ani raději neříkal. Mám v plánu kupovat ještě pračku, ale u vás už zcela jistě ji kupovat nebudu. Neměl jsem celkově příjemný pocit z nákupu, byl jsem rad, až z obchodu odejdu. Jinak, co se tyče samotných prodavačů, tak jsem zase naopak byl velmi spokojený s obsluhou a nakonec s výběrem zboží. Původně jsem měl zájem o jiné zboží, levnější a doporučili mi téměř o 5000 Kč dražší variantu. S výběrem jsem spokojený. Dekuji. Máčka',3,'2019-04-27 14:03:10.000000',NULL,1,11,NULL,NULL),(15,5,'Rychlost','rychlost, bez závad',4,'2019-04-23 10:05:00.000000',NULL,1,11,'[{"item":"rychlost doručení", "item":"komunikace"}]',NULL),(16,6,'Slusni','Doporučuji!',5,'2019-04-26 10:30:00.000000',NULL,1,11,'[{"item":"v místě bydlíště,slušn a ochotní"}]',NULL),(17,3,'Dodání','Rychlost',5,'2019-04-02 14:00:00.000000',NULL,1,12,'[{"item":"profesionální přístup"}]',NULL),(18,4,'rychlost doručení','s tímto obchodem jsem maximálně spokojen',4,'2019-04-21 13:00:00.000000',NULL,1,12,NULL,NULL),(19,5,'Komunikace','Perfektní komunikace on line, v pondělí večer jsem objednala lednici a ve středu ráno jsem ji měla doma v Praze',3,'2019-04-25 13:00:00.000000',NULL,1,12,NULL,NULL),(20,6,'Ceny','ceny',5,'2019-03-04 01:00:00.000000',NULL,1,12,'[{"item":"okamžitý odvoz zboží domů a odvoz a likvidace starého"}',NULL),(21,3,'Sušička','V pořadí moje 3. pračka (Tatramat, Whirlpool). Zakoupená AEG má maximálně snadnou obsluhu, velkou možnost kombinace a úpravy programů dle vlastních požadavků, velice tichý chod, i při odstřeďování na max. obrátky. Sušení jsem zatím nevyzkoušela.',1,'2019-04-14 14:45:50.000000',1,1,NULL,NULL,'[{"item":"Celý proces praní i sušení je přes 5 hodin. To je ale běžné."},{"item":"velmi náročným ženám bude možná vadit menší výběr programů, za mě ale dostačující, víc nepotřebuji našla jsem tam všechny co potřebuji"},{"item":"o ničem nevím"}]'),(22,3,'Hlučnost','Je to naše první pračka se sušičkou. Zvolili jsme tuto variantu k vůli úspoře místa.',5,'2019-03-31 14:15:13.000000',5,1,NULL,'[{"item":"2v1,nezabere moc místa"},{"item":"zatím vše ok"},{"item":"Skvělé ovládání a manipulace s dotikovým displeiem"}]','[{"item":"Celý proces praní i sušení je přes 5 hodin. To je ale běžné."},{"item":"velmi náročným ženám bude možná vadit menší výběr programů, za mě ale dostačující, víc nepotřebuji našla jsem tam všechny co potřebuji"},{"item":"o ničem nevím"}]'),(23,3,'tichý chod','Zatím spokojenost.',3,'2019-03-30 10:05:08.000000',9,1,NULL,'[{"item":"zatím vše ok"},{"item":"Skvělé ovládání a manipulace s dotikovým displeiem"}]','[{"item":"Celý proces praní i sušení je přes 5 hodin. To je ale běžné."},{"item":"velmi náročným ženám bude možná vadit menší výběr programů, za mě ale dostačující, víc nepotřebuji našla jsem tam všechny co potřebuji"},{"item":"o ničem nevím"}]'),(24,3,'tichý chod','Po sušící fázi je třeba buben, těsnění a vnitřek dvířek otřít vlhkým hadrem a čas od času spustit speciálni čistící program na odstranění vláken uvnitř bubnu.',2,'2019-04-05 20:46:34.000000',15,1,NULL,'[{"item":"zatím vše ok"},{"item":"Skvělé ovládání a manipulace s dotikovým displeiem"}]','[{"item":"Celý proces praní i sušení je přes 5 hodin. To je ale běžné."}]'),(25,3,'Tichá','Spokojenost, zatim se seznamujeme.',4,'2019-04-11 06:43:59.000000',17,1,NULL,'[{"item":"Pračka je tichá a nevibruje."},{"item":"Ač v angličtině, jednoduché ovládání."},{"item":"velmi tichá"}]','[{"item":"Celý proces pr